// src/pages/SociedadForm.jsx
import React, { useState } from "react";
import axios from "axios";
import { Accordion, Card, Button, Form } from "react-bootstrap";

const SociedadForm = () => {
  const [formData, setFormData] = useState({
    razon_social: "",
    nombre_comercial: "",
    nif: "",
    forma_juridica: "",
    fecha_constitucion: "",
    domicilio: "",
    localidad: "",
    provincia: "",
    cp: "",
    telefono: "",
    email: "",
    web: "",
    admin1: "",
    admin2: "",
    cnae: "",
    f_inicio: "",
    objeto_social: "",
    observaciones: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        "http://localhost:5000/sociedades/pdf",
        formData,
        { responseType: "blob" }
      );
      const url = window.URL.createObjectURL(new Blob([res.data]));
      const link = document.createElement("a");
      link.href = url;
      link.setAttribute("download", "solicitud_sociedades.pdf");
      document.body.appendChild(link);
      link.click();
    } catch (err) {
      console.error(err);
    }
  };

  return (
    <div className="container mt-4 mb-5">
      <h2 className="text-center mb-4">Solicitud de Sociedades</h2>
      <Form onSubmit={handleSubmit}>
        <Accordion defaultActiveKey="0">
          {/* Datos Generales */}
          <Accordion.Item eventKey="0">
            <Accordion.Header>Datos Generales</Accordion.Header>
            <Accordion.Body>
              <Form.Group className="mb-3">
                <Form.Label>Razón Social</Form.Label>
                <Form.Control name="razon_social" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>NIF</Form.Label>
                <Form.Control name="nif" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Domicilio</Form.Label>
                <Form.Control name="domicilio" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Provincia</Form.Label>
                <Form.Control name="provincia" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Teléfono</Form.Label>
                <Form.Control name="telefono" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Email</Form.Label>
                <Form.Control type="email" name="email" onChange={handleChange} />
              </Form.Group>
            </Accordion.Body>
          </Accordion.Item>

          {/* Representantes */}
          <Accordion.Item eventKey="1">
            <Accordion.Header>Representantes</Accordion.Header>
            <Accordion.Body>
              <Form.Group className="mb-3">
                <Form.Label>Administrador 1</Form.Label>
                <Form.Control name="admin1" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Administrador 2</Form.Label>
                <Form.Control name="admin2" onChange={handleChange} />
              </Form.Group>
            </Accordion.Body>
          </Accordion.Item>

          {/* Actividad */}
          <Accordion.Item eventKey="2">
            <Accordion.Header>Actividad y CNAE</Accordion.Header>
            <Accordion.Body>
              <Form.Group className="mb-3">
                <Form.Label>CNAE</Form.Label>
                <Form.Control name="cnae" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Fecha Inicio Actividad</Form.Label>
                <Form.Control
                  type="date"
                  name="f_inicio"
                  onChange={handleChange}
                />
              </Form.Group>
              <Form.Group className="mb-3">
                <Form.Label>Objeto Social</Form.Label>
                <Form.Control name="objeto_social" onChange={handleChange} />
              </Form.Group>
            </Accordion.Body>
          </Accordion.Item>

          {/* Observaciones */}
          <Accordion.Item eventKey="3">
            <Accordion.Header>Observaciones</Accordion.Header>
            <Accordion.Body>
              <Form.Group className="mb-3">
                <Form.Label>Observaciones</Form.Label>
                <Form.Control
                  as="textarea"
                  rows={3}
                  name="observaciones"
                  onChange={handleChange}
                />
              </Form.Group>
            </Accordion.Body>
          </Accordion.Item>
        </Accordion>

        <div className="text-center mt-4">
          <Button type="submit" variant="primary">
            Generar PDF
          </Button>
        </div>
      </Form>
    </div>
  );
};

export default SociedadForm;
